function aGraphTextShape() {
    var text = new createjs.Text("a (м/с²)", "italic 16px 'STIX Two Math'", "#000000");
    text.regX = -10;
    text.outline = 0;
    text.outlineColor = "#FFFFFF";
    text.scaleX = text.scaleY = 0.9;
    return text;
    
}

